  \"2015-09-26T20:07:33.467624\",\n\t\"name\": \"hawaii-coral-reef-assessment-and-monitoring-program-cramp-benthic-data-from-1999-2001-nodc-acce\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of CRAMP surveys
  taken in 1999-2001 and includes quantitative estimates of substrate type, species
  type, and percent coverage. Fish data are included in a separate submission. The
  types and coverages were derived objectively from photographic images using PointCount99,
  a software package which analyzes random points on images of coral reefs and substrate.
  This dataset does not include the images from video transects however these have
  been provided to NOAA separately. Photoquadrats are not included in this set. There
  are 32 survey sites, with 27 of these having both a shallow and deep transect. These
  sites are located on Kauai, Oahu, Maui, Kahoolawe, and Hawaii. Typically, one sampling
  date was made for each site per year. Annual surveys are scheduled at these sites
  and additional sites through at least 2002. This dataset replaces datasets previously
  given to NODC with NODC Accessions Numbers 0000757 and 0000513.\",\n\t\"license_title\":
